Wushu (2008) 

Hongkong
Actie / Drama
104 minuten

geregisseerd door Antony Szeto
met Yachao Wang, Sammo Hung Kam-Bo en Fengchao Liu

Het verhaal centreert zich rondom Li Er. Hij is een getalenteerde Sanda vechter die verliefd wordt op een medestudente. Aangezien zij de opleiding in Wushu volgt besluit hij Sanda te laten vallen en zich voor dit onderdeel in te schrijven. Dit gaat compleet tegen de plannen van de coach in. Deze zag in Li Er een groot talent en ziet alles nu in het water vallen. Voor Li Er wordt het ook alles behalve makkelijk. In Sanda was hij erg goed en voor Wushu stelt hij nog niets voor. Hij moet zich dus extra bewijzen. Tegelijkertijd moet hij proberen het meisje voor zich te winnen en er voor zorgen dat hij niet van school gestuurd wordt vanwege zijn slechte cijfers.


